import React from "react";
import { Link } from 'react-router-dom'
import AppointmentForm from "../../layout/AppointmentForm";
import PatientList from "../../layout/PatientList";


const Dashboard: React.FC = () => {
  // Exemplo: Número total de pacientes e consultas agendadas
  const totalPatients = 100;
  const scheduledAppointmentsToday = 15;

  return (
    <div>
      <h1>Dashboard</h1>
      <Link to="/appointment">Agendar Consulta</Link>
      <Link to="/patients">Lista de pacientes</Link>
      <div>Total de Pacientes: {totalPatients}</div>
      <div>Consultas Agendadas para Hoje: {scheduledAppointmentsToday}</div>
    </div>
  );
};

export default Dashboard;
